import React from "react";
import './AnimeListe.css'

export default function SearchListe (anime){
    return (
        <div>
            <ul>
                <p key={anime.mal_id} className="animeCertain">
                    <h1 className="animeTitel"> Titel: {anime.titel}</h1>
                    <img className="animeBild" src={anime.image_url} alt='' />
                    <ul className="animeBeschreibung">
                        <h2> Genre: {0}</h2>
                        <h2> Folgen: {anime.episodes}</h2>
                        <h2> Wertung: {anime.score}</h2>
                    </ul>
                </p>
            </ul>
        </div>

    );
}
